import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Navbar.css';

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="navbar-logo">
                <Link to="/">WishList</Link>
            </div>
            <ul className="navbar-links">
                <li><Link to="/explore">Explorar</Link></li>
                <li><Link to="/activity">Actividad</Link></li>
                <li><Link to="/reminders">Recordatorios</Link></li>
                <li><Link to="/new-wish" className="new-wish-button">Nuevo Deseo</Link></li>
            </ul>
            <div className="navbar-profile">
                <Link to="/profile">
                    <img src="/path-to-profile-image.jpg" alt="Perfil" />
                </Link>
            </div>
        </nav>
    );
};

export default Navbar;
